import axios from 'axios';
import {axiosPrivate} from "../api/axios";

export class PersonaService {



    getPersonas() {
        const token = JSON.parse(sessionStorage.getItem('token'));
        const configToken = { headers: {"Authorization" : `Bearer ${token}`}};

        return axiosPrivate.get('entidad/2/unidadEjecutora/list',configToken).then(res => res.data);
    }
    postPersona(data){
        const token = JSON.parse(sessionStorage.getItem('token'));
        const configToken = { headers: {"Authorization" : `Bearer ${token}`}};
        return  axiosPrivate.post('documento/2/persona/create', JSON.stringify(data),configToken).then(res => res.data).catch(error => {
        });
    }

}
